import React from 'react';
import "../styles/home.css";

const Home: React.FC = () => {
  return (
    <div className="home-container">
      <div className="buttons-container">
        <button className="start-button">Bắt đầu</button>
        <button className="intro-button">Giới thiệu</button>
      </div>
    </div>
  );
};

export default Home;
